import Item from "../Item/Item";
import ItemCount from "../ItemCount/ItemCount"
const ItemList = ({ products }) => {
  return (
    <>
      
      {products.map((product) => {
        console.log(product);
        return (
        <>
          <Item
           key={product.id} 
           title={product.title}
           image={product.image}
           descripcion={product.descripcion} 
           price={product.price} />
          <ItemCount stock={10} initial={1} />
        </>  
        );
      })}
    </>
  );
};
export default ItemList;
